#	insert data "manually" into table fe2010 (credit to http://sqlizer.io for making this easy)
#	load data from FE2011.csv into table fe2011
#	update tables fe2010 and fe2011 with the Intercept and Slope
#	update tables fe2010 and fe2011 with calculated predicted values
#	Intercept and Slope averages of training Models 1, 2, 3 (MyFE2010_v5_Final.xlsm - Sheet: Q.6b-e CrossVal)
