# ==================================================================================================================
# DATABASE: fuel_economy
# ==================================================================================================================
CREATE DATABASE IF NOT EXISTS fuel_economy;
USE fuel_economy;

# ==================================================================================================================
# TABLE: fe2010 - NOTE: "INSERT" code starts at line 53 and ends at line 1159
# ==================================================================================================================
CREATE TABLE IF NOT EXISTS fe2010 (
  id int(11) NOT NULL AUTO_INCREMENT,
  created_at datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  updated_at datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  NumCyl int(11) DEFAULT NULL,
  NumGears int(11) DEFAULT NULL,
  TransLockup int(11) DEFAULT NULL,
  TransCreeperGear int(11) DEFAULT NULL,
  IntakeValvePerCyl int(11) DEFAULT NULL,
  ExhaustValvesPerCyl int(11) DEFAULT NULL,
  VarValveTiming int(11) DEFAULT NULL,
  VarValveLift int(11) DEFAULT NULL,
  EngDispl double(4,2) DEFAULT NULL,
  FE double(10,6) DEFAULT NULL,
  Intercept double(10,6) DEFAULT NULL,
  Slope double(10,6) DEFAULT NULL,
  predicted_values double(10,6) DEFAULT NULL,
  PRIMARY KEY (id)
);

UPDATE fe2010 SET Intercept = 50.66730331, Slope = -4.556576892;
UPDATE fe2010 SET predicted_values = Intercept + (Slope * EngDispl);

# ==================================================================================================================
# TABLE: fe2011
# ==================================================================================================================
CREATE TABLE IF NOT EXISTS fe2011 (
  id int(11) NOT NULL AUTO_INCREMENT,
  created_at datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  updated_at datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  NumCyl int(11) DEFAULT NULL,
  NumGears int(11) DEFAULT NULL,
  TransLockup int(11) DEFAULT NULL,
  TransCreeperGear int(11) DEFAULT NULL,
  IntakeValvePerCyl int(11) DEFAULT NULL,
  ExhaustValvesPerCyl int(11) DEFAULT NULL,
  VarValveTiming int(11) DEFAULT NULL,
  VarValveLift int(11) DEFAULT NULL,
  EngDispl double(4,2) DEFAULT NULL,
  FE double(10,6) DEFAULT NULL,
  Intercept double(10,6) DEFAULT NULL,
  Slope double(10,6) DEFAULT NULL,
  predicted_values double(10,6) DEFAULT NULL,
  PRIMARY KEY (id)
);
LOAD DATA LOCAL INFILE
'C:/your_path_here/FE2011.csv' INTO TABLE fe2011
FIELDS TERMINATED BY '|'
LINES TERMINATED by '\n'
IGNORE 1 LINES
(EngDispl, NumCyl, FE, NumGears, TransLockup, TransCreeperGear, IntakeValvePerCyl, ExhaustValvesPerCyl, VarValveTiming, VarValveLift);

UPDATE fe2011 SET Intercept = 50.66730331, Slope = -4.556576892;
UPDATE fe2011 SET predicted_values = Intercept + (Slope * EngDispl);

